script: |
  super -f text -I q10345.spq | sort > q10345.out

inputs:
  - name: q10345.spq
    data: |
      SELECT + - col0 * - + ( 76 ) * - ( - col2 ) * - + CAST ( + 76 AS INTEGER ) + CAST ( col2 AS REAL ) * + - col0 + - + 17 * - col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 * col1 * col2 BETWEEN NULL AND - 7;
  - name: tab1

outputs:
  - name: q10345.out
    data: |
